/* eslint no-unused-vars: 0 */
import ifDefined from '@ui5/webcomponents-base/dist/renderer/ifDefined.js';
import { html, svg, repeat, classMap, styleMap } from '@ui5/webcomponents-base/dist/renderer/LitRenderer.js';
const block0 = (context) => { return html`<div	class="${classMap(context.classes.main)}"	dir="${ifDefined(context.rtl)}"	role="region"	aria-labelledby="${ifDefined(context._id)}-desc ${ifDefined(context._id)}-heading">	${ context.hasHeader ? block1(context) : undefined }<section role="group" aria-label="${ifDefined(context.ariaCardContentLabel)}"><slot></slot></section><span id="${ifDefined(context._id)}-desc" class="ui5-hidden-text">${ifDefined(context.ariaCardRoleDescription)}</span></div>`; };
const block1 = (context) => { return html`<div class="${classMap(context.classes.header)}"			@click="${context._headerClick}"			@keydown="${context._headerKeydown}"			@keyup="${context._headerKeyup}"			role="${ifDefined(context.ariaHeaderRole)}"			aria-labelledby="${ifDefined(context._id)}-subheading ${ifDefined(context._id)}-status"			aria-level="${ifDefined(context.ariaLevel)}"			aria-roledescription="${ifDefined(context.ariaCardHeaderRoleDescription)}"			tabindex="0">			${ context.hasAvatar ? block2(context) : undefined }<div class="ui5-card-header-text">				${ context.heading ? block3(context) : undefined }${ context.subheading ? block4(context) : undefined }</div><span id="${ifDefined(context._id)}-status" part="status" class="ui5-card-status">${ifDefined(context.status)}</span></div>	`; };
const block2 = (context) => { return html`<div class="ui5-card-avatar" aria-label="${ifDefined(context.ariaCardAvatarLabel)}"><slot name="avatar"></slot></div>			`; };
const block3 = (context) => { return html`<div id="${ifDefined(context._id)}-heading" class="ui5-card-heading" part="heading">${ifDefined(context.heading)}</div>				`; };
const block4 = (context) => { return html`<div id="${ifDefined(context._id)}-subheading" class="ui5-card-subheading" part="subheading">${ifDefined(context.subheading)}</div>				`; };

export default block0;
